import React from 'react';
import { Container } from 'react-bootstrap';
import { FaShieldAlt } from 'react-icons/fa';

const VettedProfessionalsSection = () => {
  return (
    <div className='bg-primary text-white' style={{ backgroundColor: '#f5f5f5', padding: '3rem 0' }}>
      <Container className="text-center">
        <div className="d-flex justify-content-center align-items-center mb-2">
          <FaShieldAlt size={30} className="text-primary me-2" />
          <h4 className="fw-semibold m-0">Vetted, Screened Professionals</h4>
        </div>
        <p className=" mx-auto" style={{ maxWidth: '600px' }}>
          Cleaning and handyman tasks booked and paid for through our platform are performed by experienced, vetted providers who are highly rated by customers like you.
        </p>
        <a href="#" style={{ color: '#00aaff', fontWeight: 500, textDecoration: 'none' }}>
          Learn more.
        </a>
      </Container>
    </div>
  );
};

export default VettedProfessionalsSection;
